DROP TABLE IF EXISTS `tedu_region`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tedu_region` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `parentid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '父节点id',
  `name` varchar(120) NOT NULL DEFAULT '' COMMENT '行政区划名称',
  `parentpath` varchar(25) NOT NULL COMMENT '当前行政区划的父路径',
  `firstletter` char(1) NOT NULL COMMENT '当前行政区划的首字母',
  `type` tinyint(1) NOT NULL DEFAULT '-1' COMMENT '行政区划类型，未定义[-1],省[1],市[2],县[3],乡[4]',
  `created` int(10) NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`),
  KEY `idx_parentid` (`parentid`),
  KEY `idx_name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=1833277 DEFAULT CHARSET=utf8 COMMENT='行政区划表';
/*!40101 SET character_set_client = @saved_cs_client */;

